import React from 'react';
import './Navbar.css';

function Navbar() {
    return (
        <nav className="navbar">
            //로고 영역
            <div className="navbar-logo">
                <a href="/">
                    <img src="public/image/logo.png" alt="EwhaCCC_Logo"/>
                </a>
            </div>

            //햄버거 메뉴 토글 버튼
            <div className="navbor_toggleBtn">
                <a href="/">
                    <img src="public/image/menu.png" alt="Menu"/>
                </a>
            </div>

        </nav>
    );
}

export default Nav;
